import React from "react";
import data from "./data";

export default class IndexList extends React.Component{
    constructor(props){
    super(props);
    const numbers = [1, 2, 3, 4, 5];
    const listItems = data.map((author) =>
      <li>{author}</li>
    );
    }

    render(){
        return listItems;
    }
}

const numbers = [1, 2, 3, 4, 5];
const listItems = numbers.map((numbers) =>
  <li>{numbers}</li>
);
